package homeworks.hw4;//В классе MyQueue реализуйте очередь с помощью LinkedList со следующими методами:////        enqueue() - помещает элемент в конец очереди//        dequeue() - возвращает первый элемент из очереди и удаляет его//        first() - возвращает первый элемент из очереди, не удаляя//        getElements() - возвращает все элементы в очередиimport java.util.LinkedList;public class MyQueye<T> {    LinkedList<T> elements = new LinkedList<>();    public void enqueue(T element){        // Напишите свое решение ниже        elements.add(element);    }    public T dequeue(){        // Напишите свое решение ниже        return elements.pollFirst();    }    public T first(){        // Напишите свое решение ниже        return elements.peekFirst();    }    public LinkedList<T> getElements() {        // Напишите свое решение ниже        elements.toArray();        return elements;    }}